import styled from 'styled-components';

const Wrapper = styled.nav`
    max-width: var(--max-width-header);
  .top-header-center {
    display: flex;
    align-items: center;
    justify-content: center;
    gap: 0.8rem;
    p {
      color: #fff;
    }
    span{
      color: #fff;
    }
  }

  .top-header {
    height: 4.8rem;
    background: #000;
    display: flex;
    align-items: center;
    justify-content: center;
  }
`;

export default Wrapper;
